      );
    },

    getColor(code) {
      if (this.outside.includes(code)) return "#C0C0C0";

      const country = this.getCountry(code);
      if (!country) return "#d9d9d9";

      const yes = /(yes|lockdown)/gi.test(country.lockdown);
      const mild = /mild/gi.test(country.lockdown);
      const no = /no/gi.test(country.lockdown);
      const unkown = /unkown/gi.test(country.lockdown);

      if (yes) return "#1c4587";
      if (mild) return "#6d9eeb";
      if (no) return "#ea4335";
      if (unkown) return "#d9d9d9";

      return "#434343";
